-- ----------------------------
-- Table structure for core_rubros
-- ----------------------------
DROP TABLE IF EXISTS `core_rubros`;
CREATE TABLE `core_rubros`  (
  `idRubro` int UNSIGNED NOT NULL AUTO_INCREMENT,
  `Codigo` varchar(60) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `Nombre` varchar(240) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `idAfectoIVA` int UNSIGNED NOT NULL,
  `CategoriaTributaria` int UNSIGNED NOT NULL,
  `DispInternet` int UNSIGNED NOT NULL,
  PRIMARY KEY (`idRubro`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 701 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci COMMENT = 'Fija' ROW_FORMAT = Dynamic;

