-- ----------------------------
DROP TABLE IF EXISTS `core_ubicacion_comunas`;
CREATE TABLE `core_ubicacion_comunas`  (
  `idComuna` int UNSIGNED NOT NULL AUTO_INCREMENT,
  `idCiudad` int UNSIGNED NOT NULL,
