  `Wheater` varchar(220) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  PRIMARY KEY (`idComuna`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 354 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci COMMENT = 'Fija' ROW_FORMAT = Dynamic;

