INSERT INTO `sitios_listado_body` VALUES (1, 1, 2, 'bx bx-receipt', '', 'Dashboard', '', 'Toma decisiones rpidas, reacciona rpido, s eficiente.', '', '', '', '', 0, 0, 1, 1, '');
INSERT INTO `sitios_listado_body` VALUES (2, 1, 2, 'bx bx-cube-alt', '', 'Tiempo real', '', 'Obtn mayor control frente a los parmetros exigidos por tu empresa.', '', '', '', '', 0, 0, 1, 2, '');
INSERT INTO `sitios_listado_body` VALUES (3, 1, 2, 'bx bx-images', '', 'Trazabilidad', '', 'Tener la informacin a mano siempre ser tu mejor arma.', '', '', '', '', 0, 0, 1, 3, '');
INSERT INTO `sitios_listado_body` VALUES (4, 1, 2, 'bx bx-shield', '', 'Informes', '', 'Descarga informes en PDF y Excel para obtener los reportes.', '', '', '', '', 0, 0, 1, 4, '');
INSERT INTO `sitios_listado_body` VALUES (5, 1, 1, 'ri-gps-line', 'Crosschecking', 'Pulverizadores agrcolas', '', 'Monitoreo de aplicaciones fitosanitarias en tiempo real.  Hacemos inteligente cualquier tipo de pulverizador, permitiendo ver KPIs de las aplicaciones fitosanitarias y as tomar decisiones de la calidad de stas.', '', 'Ver mas', '', 'view_servicio_1.php', 2, 1, 1, 1, 'Crosschecking.jpg');
INSERT INTO `sitios_listado_body` VALUES (6, 1, 1, 'ri-gps-line', 'Crossweather', 'Ventiladores contra heladas', '', 'Variables climticas para campos agrcolas. Prediccin de heladas con 93% de precisin en tiempo real con inteligencia artificial. Tambin es integrable a aspas anti-heladas y as verificar el correcto funcionamiento.', '', 'Ver mas', '', 'view_servicio_2.php', 2, 1, 1, 2, 'Crossweather.jpg');
INSERT INTO `sitios_listado_body` VALUES (7, 1, 1, 'ri-gps-line', 'CrossC', 'Monitoreo temperatura', '', 'Monitoreo de temperatura y humedad relativa  en tiempo real para ambientes controlados 24/7. Perfecto para la trazabilidad de cmaras de fro, camiones frigorficos, salas de proceso de alimentos, lneas de proceso de frutas y prefros.', '', 'Ver mas', '', 'view_servicio_3.php', 2, 1, 1, 3, 'CrossC.png');
INSERT INTO `sitios_listado_body` VALUES (8, 1, 1, 'ri-gps-line', 'Crosstrack', 'Gestin de flota con GPS', '', 'Ms que un simple GPS Monitorea cualquier tipo de vehculo, obteniendo informes  y alertas que permiten tomar decisiones: ubicacin en tiempo real, ruta, kilmetros, tiempos de detencin, almacenaje.', '', 'Ver mas', '', 'view_servicio_4.php', 2, 1, 1, 4, 'Crosstrack.jpg');
INSERT INTO `sitios_listado_body` VALUES (9, 1, 1, 'ri-gps-line', 'Crossenergy', 'Consumo elctrico en tiempo real', '', 'Para monitorear el consumo elctrico total de una planta y por centro de costos. Podrs obtener informacin valiosa para gestionar la eficiencia elctrica. Podrs ver distintas variables, entre ellas: Peaks y demanda mxima suministrada.', '', 'Ver mas', '', 'view_servicio_5.php', 2, 1, 1, 5, 'Crossenergy.png');
INSERT INTO `sitios_listado_body` VALUES (10, 1, 1, 'ri-gps-line', 'Crosscrane', 'Maquinaria de alto tonelaje', '', 'Sistema de monitoreo en tiempo real de todo tipo de maquinaria que tenga motor y panel elctrico. El objetivo de este servicio es conocer las horas de uso real del equipo, balance de lneas elctricas de motores, KPIs, alertas y apagado remoto.', '', 'Ver mas', '', 'view_servicio_6.php', 2, 1, 1, 6, 'Crosscrane.png');
INSERT INTO `sitios_listado_body` VALUES (11, 1, 10, '', '', 'Como 1', '', 'Cargamos en la plataforma  y en conjunto con el cliente- los <strong>datos</strong> correspondientes al servicio elegido.', '', '', '', '', 0, 0, 1, 1, 'como 1.png');
INSERT INTO `sitios_listado_body` VALUES (12, 1, 10, '', '', 'Como 2', '', 'Adems, configuramos los parmetros necesarios del servicio tomado para configurar alertas de ejecucin/operacin.', '', '', '', '', 0, 0, 1, 2, 'como 2.png');
INSERT INTO `sitios_listado_body` VALUES (13, 1, 10, '', '', 'Como 3', '', 'Se crea una caja de telemetra con internet, circuitera y sensores especficos segn el tipo de servicio que requiera el cliente.', '', '', '', '', 0, 0, 1, 3, 'como 3.png');
INSERT INTO `sitios_listado_body` VALUES (14, 1, 10, '', '', 'Como 4', '', 'Instalamos esta caja de telemetra en el equipamiento productivo del cliente, como un tractor; gra; nebulizador; vehculo general; cmara de fro; campo agrcola; motores elctricos, etc.', '', '', '', '', 0, 0, 1, 4, 'como 4.png');
INSERT INTO `sitios_listado_body` VALUES (15, 1, 10, '', '', 'Como 5', '', 'La caja de telemetra enva los datos mediante internet a nuestra plataforma web, donde el cliente podr ingresar y monitorear los KPIs de los distintos servicios.', '', '', '', '', 0, 0, 1, 5, 'como 5.png');
INSERT INTO `sitios_listado_body` VALUES (16, 1, 10, '', '', 'Como 6', '', 'Te entregramos lainformacin en tiempo real en formato dashboard e informes ejecutivos para que puedas tomar decisiones en equipo y en el menor tiempo posible.', '', '', '', '', 0, 0, 1, 6, 'como 6.png');
INSERT INTO `sitios_listado_body` VALUES (17, 1, 10, '', '', 'Como 7', '', 'Revisa desde cualquier dispositivo las alertas fuera de parmetro configuradas anteriormente. A la plataforma web puedes ingresar multidispositivo y las alertas las podrs ver desde tu correo.', '', '', '', '', 0, 0, 1, 7, 'como 7.png');
INSERT INTO `sitios_listado_body` VALUES (18, 1, 11, '', '', 'Qu es Crosstech?', '', 'Somos un equipo compuesto por profesionales de diferentes aptitudes con el objetivo comn de crear tecnologa para el 2020; IoT internet de las cosas, inteligencia artificial, ERP y desarrollos personalizados. Para nosotros, el famoso BIGDATA es sin duda lo ms valioso para nuestros clientes.', '', '', '', '', 0, 0, 1, 1, '');
INSERT INTO `sitios_listado_body` VALUES (19, 1, 11, '', '', 'Qu es el bigdata?', '', 'BIGDATA, hace referencia la obtencin masiva de datos estructurados, para luego trabajar con ellos y entregar informacin relevante. Nuestra forma de obtener estos datos es a travs de sensores que midan variables de todo tipo. Si adicionalmente, conectamos a internet esta lectura de variables, estaremos en presencia del IoT (internet de las cosas). Puedes revisar nuestros servicios', '', '', '', '', 0, 0, 1, 2, '');
INSERT INTO `sitios_listado_body` VALUES (20, 1, 11, '', '', 'Qu es IoT (internet of the things/internet de las cosas)', '', 'IoT es conectar a internet cualquier objeto inerte para obtener informacin del comportamiento de ciertas variables sin interaccin humana de por medio. Por ejemplo, si instalamos sensores en una tractor agrcola para obtener datos (bigdata) del comportamiento de ste, y adems, transferimos por internet estos a datos a una plataforma web o app mvil para mostrarlos, estaremos en presencia del internet de las cosas. Recomendamos revisar crosschecking ', '', '', '', '', 0, 0, 1, 3, '');
INSERT INTO `sitios_listado_body` VALUES (21, 1, 11, '', '', 'Qu es la telemetra?', '', 'Telemetra, quiere decir, como dice la palabra Tele (lejos)  metra (medicin), es decir, medir alguna variable a distancia. Nuestro equipo prove completo servicio desde el hardware para medir la variable, hasta la plataforma web para visualizar esta informacin.', '', '', '', '', 0, 0, 1, 4, '');
INSERT INTO `sitios_listado_body` VALUES (22, 1, 11, '', '', 'Qu puedo hacer en la plataforma?', '', 'Nuestra plataforma crosstech, abarcan todos los servicios que puedas encontrar en nuestra web. Esta plataforma cuenta con una robusta estructura que permite crear multiusuarios, alertar cuando existan parmetros fuera de rango (ej: tractor excede velocidad de aplicacin de agroqumicos), personalizacin y escalamiento de alertas, inteligencia artificial para predecir alguna variable con respecto al comportamiento histrico (ej: Temperatura dentro de una hora. Ver crossweather )', '', '', '', '', 0, 0, 1, 5, '');
INSERT INTO `sitios_listado_body` VALUES (23, 1, 11, '', '', 'Qu tipos de servicios entrega Crosstech el 2020?', '', 'IoT: Monitoreo de aplicaciones de agroqumicos, unidad de meteorolgia agrcola inteligente, monitoreo de ambientes controlados, monitoreo de pozos profundos, monitoreo de gras de construccin, gestin GPS de flota.\r\n\r\nLicencias: Proveemos servicios de ERP para gestionar empresas de construccin y consecionarias de agua potable con un todas las exigencias de la superintendencia de servicios sanitarios SISS\r\n\r\nDesarrollos personalizados: Somos capaces de mucho ms! Si sientes que ninguno de estos servicios encaja con las necesidades de tu empresa, puedes solicitarnos crear tu propio proyecto para medir variables que estn dentro de nuestro alcance A Jpiter an no llegamos, pero pronto.\r\n\r\n \r\n\r\nContctanos', '', '', '', '', 0, 0, 1, 6, '');
INSERT INTO `sitios_listado_body` VALUES (24, 1, 11, '', '', 'Qu pasa si contrato ms de un servicio?', '', 'Todos los servicios estn integrados en una sola plataforma. Por lo que al contratar ms de uno, aparecern vietas en la zona principal. Ah, podrs escoger el servicio que quieras visualizar y monitorear.', '', '', '', '', 0, 0, 1, 7, '');
INSERT INTO `sitios_listado_body` VALUES (25, 1, 11, '', '', 'Como se contratan los servicios?', '', 'Puedes enviarnos un correo a ventas@crosstech.cl y cotiza los servicios que t quieras. Rpidamente, nuestro equipo se pondr en contacto contigo', '', '', '', '', 0, 0, 1, 8, '');
INSERT INTO `sitios_listado_body` VALUES (26, 1, 11, '', '', 'Qu pasa si falla un sensor?', '', 'Nuestro objetivo es entregar un servicio continuo a nuestros clientes, por lo que SIEMPRE estarn cubiertos por problemas tcnicos y sin costo alguno. (siempre y cuando sean fallas de fbricas)', '', '', '', '', 0, 0, 1, 9, '');
INSERT INTO `sitios_listado_body` VALUES (27, 1, 11, '', '', 'Cmo se conforma el cobro de los servicio?', '', 'IoT:\r\n Pago nico por concepto de instalacin\r\n Pago mensual/anual servicio de monitoreo\r\n\r\nLicencias:\r\n Pago anual con contrato renovable automticamente\r\n\r\nDesarrollos personalizados:\r\n\r\nIDEM IoT y Licencias. [El costo de desarrollo lo ponemos nosotros ;)]', '', '', '', '', 0, 0, 1, 10, '');
INSERT INTO `sitios_listado_body` VALUES (28, 1, 12, '', '', 'Cotizar', '', '', '', 'Cotizar', '', 'view_cotizar.php', 2, 1, 1, 1, '');
INSERT INTO `sitios_listado_body` VALUES (29, 1, 12, '', '', 'Ingresar', '', '', '', 'Ingresar', '', 'https://clientes.crosstech.cl/', 1, 2, 1, 2, '');

