INSERT INTO `soporte_software_listado` VALUES (1, '7-Zip', '7-Zip es un compactador de archivos con un alto ratio de compresin.', 1, 0.00000, 0, 'https://www.7-zip.org/', 'https://www.7-zip.org/', 11);
INSERT INTO `soporte_software_listado` VALUES (2, 'Ashampoo Burning Studio', 'Ashampoo Burning Studio le permite grabar todo tipo de medios; pelculas, msica o archivos. Puede crear copias de seguridad o discos de datos, extraer msica y crear CD de audio. Tambin le permite archivar sus pelculas en discos Blu-ray.Ashampoo Burning Studio viene con una gama de caractersticas avanzadas, por lo que puede hacer mucho ms que grabar discos. Viene con un editor de video verstil y fcil de usar, que le permite crear sus propias pelculas y presentaciones de diapositivas. Incluye funciones para que pueda fusionar sus imgenes y videoclips, agregar msica de fondo, subttulos, intros y outros, y transiciones. ', 2, 0.00000, 0, 'https://www.ashampoo.com/es/eur', 'https://www.ashampoo.com/es/eur/dld/5510/Ashampoo-Burning-Studio-20/', 13);
INSERT INTO `soporte_software_listado` VALUES (3, 'Ashampoo PDF', 'Ashampoo PDF Free es una aplicacin rpida para abrir, editar y crear documentos PDF. Ashampoo PDF Free abre de manera segura archivos PDF y es compatible con todos los estndares PDF. Los documentos PDF son compactos y ahorran espacio, ya que se optimizan durante el guardado con tamaos de archivo que se ajustan a sus casos de uso. ', 1, 0.00000, 0, 'https://www.ashampoo.com/es/eur', 'https://www.ashampoo.com/es/eur/dld/0074/Ashampoo-PDF-Free/', 8);
INSERT INTO `soporte_software_listado` VALUES (4, 'Ashampoo WinOptimizer', 'Ashampoo WinOptimizer 17 limpia, acelera y asegura su sistema Windows. El programa se ocupa de los problemas de mantenimiento que surgen del uso diario de Windows. Las herramientas como la optimizacin con 1 clic eliminan los discos duros, reparan accesos directos no vlidos y eliminan el historial de navegacin y las cookies para ahorrar espacio y proteger su privacidad. ', 2, 0.00000, 0, 'https://www.ashampoo.com/es/eur', 'https://www.ashampoo.com/es/eur/dld/5606/Ashampoo-WinOptimizer-17/', 7);
INSERT INTO `soporte_software_listado` VALUES (5, 'Audacity', 'Audacity es un editor y grabador de audio gratuito y fcil de usar para Windows, Mac OS X, GNU / Linux y otros sistemas operativos.', 1, 0.00000, 0, 'https://www.audacityteam.org/', 'https://www.audacityteam.org/download/', 4);
INSERT INTO `soporte_software_listado` VALUES (6, 'Avast Free Antivirus', 'Avast! Free Antivirus es un programa antivirus eficiente y completo. Es uno de los programas antivirus ms populares disponibles, gracias a la marca fiable y de confianza que Avast ha creado. Las caractersticas principales que continan haciendo tan popular a Avast! Free Antivirus son la fcil interfaz, las opciones de escaneo optimizadas y la base de datos de definiciones de virus continuamente actualizada. ', 1, 0.00000, 0, 'https://www.avast.com/es-cl/index#pc', 'https://www.avast.com/es-cl/index#pc', 7);
INSERT INTO `soporte_software_listado` VALUES (7, 'AVG Internet Security', 'AVG Internet Security  Unlimited es un conjunto esencial de herramientas de seguridad que se basa en el poderoso AVG AntiVirus FREE. No solo puede detectar y eliminar virus en su PC, sino que tambin brinda proteccin para una cantidad ilimitada de computadoras, tabletas y telfonos. De hecho, una suscripcin cubre todos los dispositivos de tu familia para mantenerte protegido todo el tiempo. ', 2, 0.00000, 0, 'https://www.avg.com/es-cl/homepage#pc', 'https://www.avg.com/es-cl/homepage#pc', 7);
INSERT INTO `soporte_software_listado` VALUES (8, 'AVG PC TuneUp', 'AVG PC TuneUp es una suite todo en uno diseada para que usted y todas las computadoras de su familia funcionen a la velocidad y eficiencia ptimas. Con AVG TuneUp, una sola suscripcin puede cubrir todos los dispositivos que tenga; ya sea una PC con Windows, una computadora porttil Mac o una tableta Android. ', 2, 0.00000, 0, 'https://www.avg.com/es-cl/homepage#pc', 'https://www.avg.com/es-cl/avg-pctuneup', 7);
INSERT INTO `soporte_software_listado` VALUES (9, 'Avira Free Antivirus', 'Avira AntiVir Personal - FREE Antivirus es una fiable solucin antivirus, que de manera rpida y constante escanea tu ordenador en busca de programas maliciosos tales como virus, troyanos, programas con puertas de atrs, hoaxes, gusanos, rastreadores de llamadas, etc. Monitoriza cada accin que ejecuta el usuario o el sistema operativo y reacciona rpidamente cuando se detecta un programa malicioso.', 1, 0.00000, 0, 'https://www.avira.com/es', 'https://www.avira.com/es', 7);
INSERT INTO `soporte_software_listado` VALUES (10, 'Bandicam', 'Con el grabador de pantalla Bandicam puede grabar en video un rea determinada en la pantalla de una PC, o puede grabar un programa que utiliza las tecnologas grficas DirectX / OpenGL.El grabador de pantalla Bandicam funciona con una alta relacin de compresin, al tiempo que mantiene la calidad del video cerca del original y Bandicam proporciona un rendimiento muy superior a otros programas que ofrecen funciones similares. ', 2, 0.00000, 0, 'https://www.bandicam.com/es/', 'https://www.bandicam.com/es/', 10);
INSERT INTO `soporte_software_listado` VALUES (11, 'Bitdefender Internet Security', 'Bitdefender Security Suite, es una suite de seguridad completa que lo mantiene seguro en lnea. La aplicacin tiene numerosos servicios integrales incluidos, como antivirus, firewall, un inmunizador de unidad USB, herramientas de navegacin y privacidad, proteccin de redes sociales, controles parentales y un filtro de spam. ', 2, 0.00000, 0, 'https://www.bitdefender.com/', 'https://www.bitdefender.com/solutions/antivirus.html', 7);
INSERT INTO `soporte_software_listado` VALUES (12, 'BitTorrent', 'BitTorrent es un cliente de torrent para compartir datos a travs del protocolo BitTorrent. El software permite a los usuarios compartir, buscar, descargar y cargar aplicaciones, msica, videos, documentos, imgenes y otros archivos. BitTorrent admite la descarga de varios archivos en paralelo desde diferentes pares. Para cada descarga o carga, la interfaz muestra la velocidad de descarga y carga, el tamao del archivo, el nombre del archivo, el progreso, las semillas, los pares, etc. El uso general se puede monitorear en vistas tabulares y grficas. Se pueden agregar nuevos archivos torrent o magnet (compatibles con Azureus) a travs de sitios de torrent o desde BitTorrent.', 1, 0.00000, 0, 'https://www.bittorrent.com/', 'https://www.bittorrent.com/products/win/bittorrent-web-compare/', 6);
INSERT INTO `soporte_software_listado` VALUES (13, 'Blender', 'Blender es una aplicacin integrada que permite la creacin de una amplia gama de contenido 2D y 3D. Blender proporciona una amplia gama de funciones de modelado, texturizado, iluminacin, animacin y posprocesamiento de video en un solo paquete. A travs de su arquitectura abierta, Blender proporciona interoperabilidad multiplataforma, extensibilidad, una huella increblemente pequea y un flujo de trabajo estrechamente integrado. Blender es una de las aplicaciones de grficos 3D de cdigo abierto ms populares del mundo. ', 1, 0.00000, 0, 'https://www.blender.org/', 'https://www.blender.org/', 1);
INSERT INTO `soporte_software_listado` VALUES (14, 'BlueStacks App Player', 'BlueStacks App Player es una estupenda herramienta que te permite ejecutar tus aplicaciones y juegos de mvil favoritos en modo pantalla completa en tu navegador, usando un PC o Mac.', 1, 0.00000, 0, 'https://www.bluestacks.com/es/index.html', 'https://www.bluestacks.com/es/index.html', 14);
INSERT INTO `soporte_software_listado` VALUES (15, 'BurnAware Free', 'BurnAware es una aplicacin de grabacin fcil de usar que le permite crear discos utilizando diferentes tipos de archivos, como archivos, documentos, msica y videos en CD, DVD y discos Blu-ray. ', 1, 0.00000, 0, 'https://www.burnaware.com/', 'https://www.burnaware.com/download.html', 13);
INSERT INTO `soporte_software_listado` VALUES (16, 'Calibre', 'Calibre es un completo administrador de la biblioteca de libros electrnicos que le permite organizar totalmente su coleccin. Con Calibre puedes convertir tus libros a mltiples formatos y luego sincronizarlos con todos tus dispositivos. ', 1, 0.00000, 0, 'https://www.calibre-ebook.com/', 'https://www.calibre-ebook.com/download', 8);
INSERT INTO `soporte_software_listado` VALUES (17, 'Ccleaner', 'CCleaner es una herramienta de limpieza y optimizacin del sistema y mejora de la privacidad gratuto (freeware). Elimina archivos sin utilizar del sistema, permitiendo a Windows correr ms rpido y liberando valioso espacio en el disco duro. Tambin limpia rastros de tus actividades en lnea como tu historial de internet. Adicionalmente contiene un limpiador de registro repleto de opciones. Pero lo mejor es que es rpido ', 1, 0.00000, 0, 'https://www.ccleaner.com/es-es', 'https://www.ccleaner.com/es-es', 7);
INSERT INTO `soporte_software_listado` VALUES (18, 'Comodo Antivirus', 'Comodo Antivirus es un conjunto slido y confiable de herramientas que proporciona un nivel de seguridad tranquilizador para las computadoras basadas en Microsoft Windows.Proporciona proteccin contra virus de calidad, que cuenta con un escner bajo demanda, proteccin en tiempo real siempre activa y una base de datos actualizada continuamente de virus y amenazas conocidos. ', 1, 0.00000, 0, 'https://antivirus.comodo.com/', 'https://antivirus.comodo.com/', 7);
INSERT INTO `soporte_software_listado` VALUES (19, 'Comodo Free Firewall', 'Comodo Free Firewall es un excelente reemplazo para la utilidad predeterminada de Windows. La interfaz es moderna, elegante e intuitiva y fcil de navegar. No solo es agradable a la vista, sino que tambin proporciona una proteccin mejorada a travs de una base de datos en la nube constantemente actualizada para mantener su sistema lo ms seguro posible. ', 1, 0.00000, 0, 'https://www.comodo.com/home/internet-security/firewall.php', 'https://www.comodo.com/home/internet-security/firewall.php', 7);
INSERT INTO `soporte_software_listado` VALUES (20, 'Comodo Internet Security', 'Comodo Internet Security es una aplicacin de seguridad gratuita que brinda proteccin completa contra ataques de virus, troyanos, gusanos, desbordamientos de bfer, ataques de da cero, spyware y piratas informticos.La aplicacin es multifactica y combina una potente proteccin antivirus, un firewall de filtrado de paquetes de clase empresarial, herramientas avanzadas de prevencin de intrusiones de host, control de aplicaciones configurables y anti-spyware. Todo en una poderosa aplicacin. ', 1, 0.00000, 0, 'https://www.comodo.com/home/internet-security/free-internet-security.php', 'https://www.comodo.com/home/internet-security/free-internet-security.php', 7);
INSERT INTO `soporte_software_listado` VALUES (21, 'CrystalDiskInfo', 'CrystalDiskInfo es una herramienta de utilidad que puede informarle sobre el rendimiento del hardware de su disco duro, incluida la probabilidad de que deje de funcionar en el futuro cercano. La aplicacin le brinda una lectura completa de toda la informacin INTELIGENTE de su computadora, as como la temperatura actual y el estado de salud.', 1, 0.00000, 0, 'https://crystalmark.info/en/', 'https://crystalmark.info/redirect.php?product=CrystalDiskInfoInstaller', 10);
INSERT INTO `soporte_software_listado` VALUES (22, 'Dia Diagram Editor', 'Dia Diagram Editor es una aplicacin de edicin visual de cdigo abierto, que se puede utilizar para dibujar numerosos tipos diferentes de diagramas. Actualmente tiene objetos especiales para ayudar a dibujar diagramas de relacin de entidad, diagramas UML, diagramas de flujo, diagramas de red y muchos otros diagramas. Tambin es posible agregar soporte para nuevas formas escribiendo archivos XML simples, usando un subconjunto de SVG para dibujar la forma. Puede cargar y guardar diagramas en un formato XML personalizado, puede exportar diagramas a varios formatos, incluidos EPS, SVG, XFIG, WMF y PNG, y puede imprimir diagramas (incluidas varias pginas). ', 1, 0.00000, 0, 'https://www.dia-installer.de/', 'https://filehippo.com/es/download_dia_diagram_editor/post_download/', 4);
INSERT INTO `soporte_software_listado` VALUES (23, 'Discord Messenger', 'Discord Messenger es una plataforma de comunicacin muy popular dirigida a los jugadores. Cree canales y salas separadas dentro de estos canales y comunquese con sus amigos por mensaje de texto o voz.Las restricciones de acceso se pueden establecer en canales individuales que restringen la entrada solo a usuarios invitados.Los canales de Discord Messenger no se centran solo en los juegos, las comunidades para casi cualquier pasatiempo, pasin o pasatiempo se pueden encontrar en lnea. ', 1, 0.00000, 0, 'https://discordapp.com/', 'https://discordapp.com/api/download?platform=win', 15);
INSERT INTO `soporte_software_listado` VALUES (24, 'Driver Genius', 'Driver Genius es una aplicacin integral que escanea su sistema en busca de problemas de controladores. Luego puede descargar los controladores que necesita y actualiza su sistema en consecuencia. Tambin puede hacer una copia de seguridad y actualizar sus controladores con unos pocos clics.', 1, 0.00000, 0, 'https://www.driver-soft.com/', 'https://www.driver-soft.com/', 3);
INSERT INTO `soporte_software_listado` VALUES (25, 'Dropbox', 'Dropbox es la forma ms fcil de almacenar, sincronizar y compartir archivos en lnea.', 1, 0.00000, 0, 'https://www.dropbox.com/', 'https://www.dropbox.com/register', 6);
INSERT INTO `soporte_software_listado` VALUES (26, 'Earth Alerts', 'Earth Alerts es una pequea aplicacin que te permite monitorear, casi en tiempo real, una variedad de eventos naturales que estn ocurriendo en cualquier parte del mundo. Las notificaciones de alerta, los informes y las imgenes le brindan una forma conveniente de ver los fenmenos naturales a medida que ocurren.Earth Alerts le permite controlar el clima extremo y otros eventos naturales de todo el mundo a travs de su interfaz optimizada. La aplicacin recupera automticamente la informacin ms reciente de varias fuentes de datos en vivo disponibles en Internet y se la presenta en una disposicin conveniente de informes, mapas e imgenes. ', 1, 0.00000, 0, 'https://www.manyjourneys.com/Joomla/', 'https://earthalerts.manyjourneys.com/', 10);
