INSERT INTO `soporte_software_listado` VALUES (31, 'FastStone Image Viewer', 'FastStone Image Viewer es un navegador, convertidor y editor de imgenes rpido, estable y fcil de usar. La aplicacin tiene una buena variedad de caractersticas, que incluyen visualizacin de imgenes, administracin, comparacin, eliminacin de ojos rojos, correo electrnico, cambio de tamao, recorte y ajustes de color. ', 1, 0.00000, 0, 'https://www.faststone.org/', 'https://www.faststone.org/FSIVDownload.htm', 10);
