INSERT INTO `soporte_software_listado` VALUES (39, 'Google Chrome', 'Chrome, el innovador navegador de Google, combina tecnologa sofisticada con una interfaz sencilla para crear una experiencia de navegacin ms rpida, segura y fcil. Lanzado en 2008, Google Chrome pas a dominar con rapidez el mercado de navegadores y se convirti en el navegador ms usado en todo el mundo a los 4 aos de su publicacin. El rpido y continuado ciclo de desarrollo de Google garantiza que el navegador siga compitiendo con el resto de navegadores web populares y avanzados disponibles. ', 1, 0.00000, 0, 'https://www.google.com/intl/es-419/chrome/', 'https://www.google.com/intl/es-419/chrome/', 6);
