INSERT INTO `soporte_software_listado` VALUES (42, 'HWMonitor', 'HWMonitor es un programa de monitoreo de hardware que lee los principales sensores de salud de los sistemas de PC. Leer los principales sensores de salud del sistema y le proporcionar informacin detallada al respecto. HWMonitor lee los principales sensores de salud de su computadora, incluidos: temperaturas, voltajes y velocidad del ventilador.', 1, 0.00000, 0, 'https://www.cpuid.com/', 'https://www.cpuid.com/softwares/hwmonitor-pro.html', 10);
