INSERT INTO `soporte_software_listado` VALUES (44, 'KiTTY', 'KiTTY es una bifurcacin de la versin 0.63 de PuTTY, el cliente telnet / SSH. La aplicacin tiene numerosas caractersticas tcnicas, incluida la capacidad de agregar contraseas automticas, ejecutar comandos automticos y puede ejecutar scripts guardados localmente en sesiones remotas, lo cual es realmente til.KiTTY tiene una GUI muy fcil de usar con iconos de sesin individuales y cuadro de configuracin. La aplicacin tambin viene con una gran caracterstica que lo protege contra la entrada accidental del teclado. ', 1, 0.00000, 0, 'https://www.9bis.net/kitty/#!index.md', 'https://www.fosshub.com/KiTTY.html', 2);
INSERT INTO `soporte_software_listado` VALUES (45, 'K-Lite Codec Pack', 'K-Lite Codec Pack es una coleccin de filtros DirectShow, codificadores VFW / ACM, y herramientas. Codificadores DirectShow y filtros son necesarios para codificar y descodificar los formatos de audio y vdeo. El K-Lite Codec Pack est diseado como una solucin fcil para reproducir todos tus archivos de audio y vdeo.', 1, 0.00000, 0, 'https://www.codecguide.com/download_k-lite_codec_pack_basic.htm', 'https://www.codecguide.com/download_k-lite_codec_pack_basic.htm', 9);
