INSERT INTO `soporte_software_listado` VALUES (48, 'LINE', 'LINE le permite compartir fotos, videos, mensajes de voz, contactos y su informacin de ubicacin fcilmente con sus amigos. Puede obtener las ltimas noticias y cupones especiales para artistas populares, celebridades, marcas y programas de televisin.Con LINE puedes intercambiar mensajes instantneos gratuitos con amigos cuando y donde quieras, con mensajes uno a uno y chats grupales. ', 1, 0.00000, 0, 'https://line.me/es-MX/', 'https://line.me/es-MX/download', 15);
