INSERT INTO `soporte_software_listado` VALUES (50, 'mIRC', 'mIRC es un cliente de Internet Relay Chat con todas las funciones para Windows que se puede utilizar para comunicarse, compartir, jugar o trabajar con otras personas en las redes IRC de todo el mundo, ya sea en conferencias grupales multiusuario o en debates privados uno a uno.Tiene una interfaz limpia y prctica que es altamente configurable y admite caractersticas como listas de amigos, transferencias de archivos, conexiones de varios servidores, cifrado SSL, soporte de proxy, pantalla UTF-8, sonidos personalizables, mensajes hablados, notificaciones de bandeja, registro de mensajes, y ms. ', 1, 0.00000, 0, 'https://www.mirc.com/', 'https://www.mirc.com/get.html', 15);
INSERT INTO `soporte_software_listado` VALUES (51, 'Mozilla Firefox', 'Mozilla Firefox es un navegador rpido, ligero y ordenado de cdigo abierto. En el momento de su lanzamiento al pblico en 2004 Mozilla Firefox fue el primer navegador que se enfrent al dominio de Microsoft Internet Explorer. Desde entonces Mozilla Firefox se ha mantenido siempre en la lista de los 3 navegadores ms populares. Las caractersticas principales que han hecho a Mozilla Firefox tan popular son la interfaz sencilla y efectiva, la velocidad del navegador y caractersticas de seguridad fuertes. El navegador es especialmente popular entre desarrolladores debido a su desarrollo de cdigo abierto y a su activa comunidad de usuarios avanzados.', 1, 0.00000, 0, 'https://www.mozilla.org/es-CL/', 'https://www.mozilla.org/firefox/download/thanks/', 6);
INSERT INTO `soporte_software_listado` VALUES (52, 'NetBeans IDE', 'Un entorno de desarrollo integrado gratuito y de cdigo abierto para desarrolladores de software. Obtiene todas las herramientas que necesita para crear aplicaciones profesionales de escritorio, empresariales, web y mviles con el lenguaje Java, C / C    e incluso lenguajes dinmicos como PHP, JavaScript, Groovy y Ruby. NetBeans IDE es fcil de instalar y usar directamente y se ejecuta en muchas plataformas, incluidas Windows, Linux, Mac OS X y Solaris. ', 1, 0.00000, 0, 'https://netbeans.org/features/index.html', 'https://netbeans.org/features/index.html', 5);
INSERT INTO `soporte_software_listado` VALUES (53, 'Nitro Pro', 'Con Nitro Pro puede abrir, revisar, encubrir y crear archivos PDF. Tambin viene con un montn de caractersticas que hacen de Nitro Pro una de las mejores aplicaciones de PDF que existen. Puedes comentar, revisar y colaborar en todo tu trabajo. Le permite llenar y guardar formularios PDF, y extraer texto e imgenes. Nitro Pro tambin tiene soporte para QuickSign, para firmar y devolver electrnicamente sus documentos en segundos.', 2, 0.00000, 0, 'https://www.gonitro.com/es/', 'https://www.gonitro.com/es/download', 8);
INSERT INTO `soporte_software_listado` VALUES (54, 'Notepad  ', 'Notepad   es un editor gratuito de cdigo fuente y un sustituto de Notepad que soporta varios lenguajes. Funciona en entorno MS Windows y su uso est regulado por la licencia GPL.Basado en un potente componente de edicin llamado Scintilla, Notepad   est escrito en C   y usa directamente la API de Win32 y STL, lo que asegura una gran velocidad de ejecucin y un menor tamao del programa. Mediante la optimizacin de tantas rutinas como sea posible sin perder la interfaz amigable con el usuario, Notepad   intenta reducir las emisiones mundiales de dixido de carbono. Al usar una menor potencia de CPU, el PC puede frenar y reducir el consumo de energa, dando como resultado un medio ambiente ms ecolgico.', 1, 0.00000, 0, 'https://notepad-plus-plus.org/', 'https://notepad-plus-plus.org/downloads/', 5);
INSERT INTO `soporte_software_listado` VALUES (55, 'OneDrive', 'OneDrive es la solucin de almacenamiento en la nube de Microsoft en respuesta a Dropbox y otros servicios en lnea similares. La aplicacin OneDrive se integra con su escritorio y funciona como cualquier otra carpeta en su PC o Mac. Los archivos copiados o movidos a las carpetas de OneDrive se cargan automticamente en el espacio de la nube. Los usuarios de Windows tambin tienen la posibilidad de acceder, explorar y transmitir documentos, fotos, videos y otros archivos desde una computadora remota que ejecuta el software OneDrive. Los documentos se pueden compartir y trabajar en colaboracin con otras personas que usan el servicio. Microsoft proporciona varios gigabytes de almacenamiento gratuito para usuarios existentes y nuevos de OneDrive.', 1, 0.00000, 0, 'https://www.microsoft.com/es-cl/p/onedrive/9wzdncrfj1p3?activetab=pivot:overviewtab', 'https://www.microsoft.com/es-cl/p/onedrive/9wzdncrfj1p3?activetab=pivot:overviewtab', 6);
INSERT INTO `soporte_software_listado` VALUES (56, 'Opera', 'Un completo navegador, Opera incluye el bloqueo de pop-ups, navegacin por pestaas, bsquedas integradas y funciones avanzadas tales como el innovador programa de Correo Electrnico de Opera, lectores de noticias RSS y Chat IRC. Y como sabemos que nuestros usuarios tienen distintas necesidades, puedes configurar el aspecto y contenido de tu navegador Opera con unos pocos clicks del ratn.', 1, 0.00000, 0, 'https://www.opera.com/es', 'https://www.opera.com/es/computer/thanks?ni=stable&os=windows', 6);
