INSERT INTO `soporte_software_listado` VALUES (58, 'Panda Antivirus', 'El nuevo Panda Antivirus proporciona la proteccin ms fcil de usar e intuitiva para su computadora. Instlelo y olvdese de virus, spyware, rootkits, piratas informticos y fraudes en lnea. Panda Free Antivirus tomar las mejores decisiones para que usted mantenga su PC protegida. ', 2, 0.00000, 0, 'https://www.pandasecurity.com/', 'https://www.pandasecurity.com/es/homeusers/downloads/', 7);
