INSERT INTO `soporte_software_listado` VALUES (60, 'Pencil', 'Pencil es una herramienta de creacin de prototipos GUI gratuita y de cdigo abierto que es rpida, fcil y funciona en mltiples plataformas.Pencil proporciona varias colecciones de formas integradas para dibujar diferentes tipos de interfaz de usuario, desde plataformas de escritorio hasta mviles. A partir de 2.0.2, Pencil se entrega con plantillas de IU para Android e iOS preinstaladas. Esto hace que sea an ms fcil comenzar a crear prototipos de aplicaciones con una instalacin simple. La lista de colecciones integradas tambin incluye formas de uso general, elementos de diagrama de flujo, formas de interfaz de usuario de escritorio / web, formas de GUI de Android e iOS. ', 1, 0.00000, 0, 'https://www.evolus.vn/en-US/Default.html', 'https://www.evolus.vn/en-US/wiki/products/pencil/pencil.html', 4);
