INSERT INTO `soporte_software_listado` VALUES (67, 'Skype', 'Skype es un software para llamar a otras personas a sus ordenadores o telfonos. Descarga Skype y empieza a hacer llamadas gratuitas a todo el mundo.Las llamadas tienen una excelente calidad de sonido y son altamente seguras gracias a una encriptacin end-to-end. Ni siquiera necesitas configurar tu firewall, router o cualquier otro dispositivo de red.', 1, 0.00000, 0, 'https://www.skype.com/es/', 'https://go.skype.com/get.skype.page', 15);
INSERT INTO `soporte_software_listado` VALUES (68, 'Sublime Text', 'Sublime Text es un editor de desarrollo y texto sper rpido y lleno de funciones. Si vas a codificar regularmente, quieres probar este increble editor (IDE).', 2, 0.00000, 0, 'https://www.sublimetext.com/', 'https://www.sublimetext.com/', 5);
INSERT INTO `soporte_software_listado` VALUES (69, 'Sumatra PDF', 'Est buscando un lector de PDF que siga el principio de que menos es ms ? Que Sumatra PDF es para ti! El programa ligero es un lector gratuito de cdigo abierto de PDF, XPS, eBook (ePub, Mobi), CHM, DjVI y Comic Book (CBZ y CBR) que se ejecuta en Windows. SumatraPDF comienza muy rpido y viene con una interfaz limpia y simple. El tamao de archivo pequeo lo hace ideal para dispositivos porttiles, por ejemplo, unidades USB. El software se puede ejecutar sin instalacin y no escribe en el registro de Windows. Adems de caractersticas bsicas como zoom e impresin, Sumatra PDF admite varios modos de visualizacin, por ejemplo, pantalla completa y modo de presentacin, mtodos abreviados de teclado y argumentos de lnea de comandos. El PDF Reader tambin incluye un complemento que se puede instalar durante la configuracin para ver documentos PDF en Firefox, Chrome y Opera.', 1, 0.00000, 0, 'https://blog.kowalczyk.info/', 'https://www.sumatrapdfreader.org/download-free-pdf-viewer.html', 8);
INSERT INTO `soporte_software_listado` VALUES (70, 'TeamSpeak', 'TeamSpeak es un software flexible, potente y escalable que permite a las personas hablar entre ellas a travs de Internet. TeamSpeak consta de software de cliente y servidor. El servidor acta como un host para mltiples conexiones de clientes, capaz de manejar literalmente miles de usuarios simultneos.', 1, 0.00000, 0, 'https://www.teamspeak.com/es/', 'https://www.teamspeak.com/es/downloads/', 6);
INSERT INTO `soporte_software_listado` VALUES (71, 'TeamViewer', 'TeamViewer es la solucin completa de acceso remoto y soporte por Internet.TeamViewer se conecta a cualquier PC o servidor en cualquier lugar del mundo en poco segundos. Puede usar por control remoto el PC de un amigo o compaero de trabajo tal y como si estuviera sentado all delante.', 1, 0.00000, 0, 'https://www.teamviewer.com/es-mx/', 'https://www.teamviewer.com/es-mx/descarga/', 6);
INSERT INTO `soporte_software_listado` VALUES (72, 'Telegram', 'Telegram es una aplicacin de mensajera centrada en la velocidad. Es rpido, fcil de usar y gratuito. Telegram se basa en el protocolo MTProto. Con Telegram, tiene la opcin de crear chats grupales con hasta 200 personas. Puede compartir videos de hasta 1 GB de tamao, puede enviar mltiples fotos desde la web y tambin puede reenviar cualquier medio que reciba al instante. Como todos sus mensajes se guardan en la nube, puede acceder fcilmente a ellos desde cualquiera de sus dispositivos que estn conectados.', 1, 0.00000, 0, 'https://www.telegram.org/', 'https://desktop.telegram.org/', 15);
INSERT INTO `soporte_software_listado` VALUES (73, 'The GIMP ', 'El GIMP es una herramienta de manipulacin de fotos multiplataforma. GIMP es un acrnimo de GNU Image Manipulation Program. El GIMP es adecuado para una variedad de tareas de manipulacin de imgenes, que incluyen retoque fotogrfico, composicin de imgenes y construccin de imgenes.Tiene muchas capacidades. Se puede usar como un programa de pintura simple, un programa de retoque fotogrfico de calidad experta, un sistema de procesamiento por lotes en lnea, un renderizador de imgenes de produccin en masa, un convertidor de formatos de imagen, etc. ', 1, 0.00000, 0, 'https://www.gimp.org/', 'https://www.gimp.org/downloads/', 4);
INSERT INTO `soporte_software_listado` VALUES (74, 'Thunderbird', 'Thunderbird es un estupendo cliente de correo creado por la misma gente que hizo el navegador Firefox.Thunderbird te da soporte IMAP/POP, un lector de RSS incluido, soporte para correo HTML, una potente bsqueda rpida, carpetas de bsqueda definidas, filtro avanzado de mensajes, agrupacin de mensajes, etiquetas, acuse de recibo, auto-rellenado de direcciones basado en libretas de direcciones inteligentes de LDAP, herramientas de importacin y la posibilidad de gestionar mltiples cuentas de correo y grupos de noticias.', 1, 0.00000, 0, 'https://www.thunderbird.net/es-CL/', 'https://download.mozilla.org/?product=thunderbird-68.7.0-SSL&os=win&lang=en-US', 8);
INSERT INTO `soporte_software_listado` VALUES (75, 'Transmission', 'Transmission-Qt es una utilidad para compartir archivos que puede descargar torrents, similar a Torrent y BitComet. La aplicacin le permite iniciar una sesin local o conectarse a una remota ingresando los detalles del host, el puerto y la autenticacin. ', 1, 0.00000, 0, 'https://transmissionbt.com/', 'https://transmissionbt.com/download/', 6);
INSERT INTO `soporte_software_listado` VALUES (76, 'uTorrent', 'Torrent es el cliente BitTorrent ms popular del mundo, a excepcin de China. Es un paquete de software pequeo pero con muchas opciones. La actualizacin Torrent 3.4 RC1 tiene multitud de nuevas caractersticas y mejoras, con lo que su uso es an mejor. Torrent dispone de un gran nmero de opciones, tiene un gran rendimiento, se mantiene estable y puede funcionar en hardware antiguo y en diferentes versiones de Windows.', 1, 0.00000, 0, 'https://www.utorrent.com/intl/es/', 'https://www.utorrent.com/downloads/complete/track/stable/os/win', 6);
INSERT INTO `soporte_software_listado` VALUES (77, 'VirtualBox', 'VirtualBox is a general-purpose full virtualizer for x86 hardware. Targeted at server, desktop and embedded use, it is now the only professional-quality virtualization solution that is also Open Source Software.', 1, 0.00000, 0, 'https://www.virtualbox.org/', 'https://www.virtualbox.org/', 14);
INSERT INTO `soporte_software_listado` VALUES (78, 'VLC Media Player', 'VLC Media Player es el reproductor de medios multiformato gratuito ms popular y ms robusto disponible. Este reproductor de medios de cdigo abierto fue publicado en 2001 por la organizacin sin nimo de lucro VideoLAN Project. VLC Media Player se volvi rpidamente muy popular gracias a sus verstiles capacidades de reproduccin multiformato. Se vio ayudado por problemas de compatibilidad y codificadores que hicieron que reproductores de medios competidores como QuickTime, Windows y Real Media Player no sirvieran para muchos formatos populares de ficheros de vdeo y msica. La interfaz fcil y bsica y una gran cantidad de opciones de personalizacin han reforzado la posicin de VLC Media Player en lo ms alto de los reproductores de medios gratuitos.', 1, 0.00000, 0, 'https://www.videolan.org/', 'https://www.videolan.org/', 9);
INSERT INTO `soporte_software_listado` VALUES (79, 'WhatsApp Messenger', 'WhatsApp es un reconocido servicio de mensajera que existe desde hace algn tiempo. Aunque puede usarlo en la web, WhatsApp ha lanzado una aplicacin de escritorio para plataformas Windows y Mac OS X.Esta nueva versin de escritorio de la aplicacin ser excelente para algunos usuarios, ya que ya no necesita ocupar espacio en su navegador web. La nueva aplicacin bsicamente funciona como una extensin de su telfono; refleja mensajes y conversaciones de su dispositivo. ', 1, 0.00000, 0, 'https://www.whatsapp.com/', 'https://www.whatsapp.com/download/', 15);
INSERT INTO `soporte_software_listado` VALUES (80, 'WinRAR', 'WinRAR es una utilidad de archivero que soporta totalmente archivos RAR y ZIP y es capaz de descomprimir archivos CAB, ARJ, LZH, TAR, GZ, ACE, UUE, BZ2, JAR, ISO, 7Z, Z. Consecuentemente hace archivos ms pequeos que la competencia, ahorra espacio en disco y los costos de transmisin.', 2, 0.00000, 0, 'https://www.rarsoft.com/', 'https://filehippo.com/es/download_winrar_32/post_download/', 11);
INSERT INTO `soporte_software_listado` VALUES (81, 'WinSCP', 'WinSCP es un cliente SFTP gratuito de cdigo abierto y un cliente FTP para Windows. El protocolo SCP heredado tambin es compatible. Su funcin principal es la copia segura de archivos entre una computadora local y una remota. ', 1, 0.00000, 0, 'https://winscp.net/eng/docs/lang:es', 'https://winscp.net/eng/download.php', 2);
INSERT INTO `soporte_software_listado` VALUES (82, 'WinUtilities', 'WinUtilities es una seleccin de herramientas profesionales, que estn diseadas para ayudarlo a optimizar el rendimiento del sistema de su computadora mediante la realizacin de tareas como eliminar archivos innecesarios y corregir atajos rotos. ', 1, 0.00000, 0, 'https://www.ylcomputing.com/', 'https://filehippo.com/es/download_winutilities/post_download/', 7);
INSERT INTO `soporte_software_listado` VALUES (83, 'WinZip', 'WinZip es la manera ms fiable de trabajar con ficheros comprimidos. Ninguna otra utilidad de compresin es tan fcil de usar ni ofrece el enfoque tan exhaustivo y de mejora de la productividad que han hecho de WinZip la herramienta estndar para la compresin de ficheros.', 2, 0.00000, 0, 'https://www.winzip.com/win/es/', 'https://www.winzip.com/win/es/', 11);
INSERT INTO `soporte_software_listado` VALUES (84, 'Wise Care 365', 'Wise Care 365 es una aplicacin para mejorar el rendimiento de la PC *, que consta de cinco elementos clave: PC Checkup, System Cleaner, System Tune-up, Privacy Protector y System Monitoring.El elemento PC Checkup puede verificar el estado general de funcionamiento de su PC, calificar su estado de salud y, si es necesario, proporcionarle soluciones de solucin rpida. ', 1, 0.00000, 0, 'https://www.wisecleaner.com/', 'https://www.wisecleaner.com/wise-care-365.html', 7);
INSERT INTO `soporte_software_listado` VALUES (85, 'Wise Data Recovery', 'Wise Data Recovery es una aplicacin pequea y liviana que puede recuperar archivos borrados accidentalmente de su computadora. Tiene una interfaz simple y limpia que le permite seleccionar la unidad que se va a escanear y luego realizar bsquedas basadas en palabras clave o criterios diferentes, ya sean archivos de imagen, audio o video, documentos, archivos comprimidos o elementos de correo electrnico. ', 1, 0.00000, 0, 'https://www.wisecleaner.com/', 'https://www.wisecleaner.com/wise-data-recovery.html', 7);
INSERT INTO `soporte_software_listado` VALUES (86, 'Wise Disk Cleaner', 'Wise Disk Cleaner lo ayuda a recuperar el espacio mal utilizado en su disco duro al eliminar fcilmente todo tipo de archivos basura redundantes, rpidamente.Wise Disk Cleaner es compatible con muchos formatos y extensiones de archivos diferentes, incluidos archivos temporales de Internet y registros de instalacin, archivos antiguos y archivos de ndice tambin. Wise Disk Cleaner se puede configurar para agregar una lista de carpetas que se incluirn en la limpieza. Tambin puede filtrar los tipos de archivos agregndolos a la lista de exclusin. ', 1, 0.00000, 0, 'https://www.wisecleaner.com/', 'https://www.wisecleaner.com/wise-disk-cleaner.html', 7);
INSERT INTO `soporte_software_listado` VALUES (87, 'Wise Game Booster', 'Wise Game Booster es una utilidad inteligente que puede optimizar su sistema para el juego al suspender temporalmente cualquier proceso innecesario, ya sea individualmente o simultneamente.La aplicacin funciona al enfocar sus recursos en el rendimiento de los juegos. Realiza un anlisis de su sistema y luego sugiere cambios especficos del proceso. ', 1, 0.00000, 0, 'https://www.wisecleaner.com/', 'https://www.wisecleaner.com/wise-game-booster.html', 7);
INSERT INTO `soporte_software_listado` VALUES (88, 'Wise Program Uninstaller', 'Wise Program Uninstaller es una herramienta til que te ayuda a desinstalar aplicaciones de tu computadora y eliminar los archivos sobrantes. Tiene algunas caractersticas adicionales bajo el cap en comparacin con la funcin predeterminada Agregar o quitar programas de Windows.', 1, 0.00000, 0, 'https://www.wisecleaner.com/', 'https://www.wisecleaner.com/wise-program-uninstaller.html', 7);
INSERT INTO `soporte_software_listado` VALUES (89, 'Wise Registry Cleaner', 'Wise Registry Cleaner es una utilidad del sistema que puede escanear el Registro de Windows y localizar cualquier informacin incorrecta u obsoleta.Despus de que Wise Registry Cleaner analice su sistema en busca de problemas, puede ver individualmente cada elemento encontrado y mostrar una descripcin detallada del problema. Si lo desea, tambin puede configurar la aplicacin para corregir estos problemas automticamente. ', 1, 0.00000, 0, 'https://www.wisecleaner.com/', 'https://www.wisecleaner.com/wise-registry-cleaner.html', 7);
INSERT INTO `soporte_software_listado` VALUES (90, 'Wise System Monitor', 'Wise System Monitor proporciona una ventana clara de los procesos en tiempo real de su sistema y el estado del hardware. La aplicacin le proporciona una lista organizada de todos los procesos que ejecutan tanto el usuario como el sistema. Con Wise System Monitor, puede cerrar cualquier proceso no crtico que no sea necesario para que su PC funcione sin problemas. ', 1, 0.00000, 0, 'https://www.wisecleaner.com/', 'https://www.wisecleaner.com/wise-system-monitor.html', 7);
INSERT INTO `soporte_software_listado` VALUES (91, 'XAMPP', 'XAMPP es una distribucin de Apache fcil de instalar para Windows, Mac OS X, Linux y Solaris. El paquete incluye el servidor web Apache, MySQL, PHP, Perl, un servidor FTP y phpMyAdmin.XAMPP ha sido diseado para ser la forma ms fcil de instalar y ejecutar un servidor de desarrollo. Hay muchos otros paquetes WAMP disponibles, pero XAMPP es uno de los ms completos que se ofrecen. Adems de Apache, MySQL y PHP, XAMPP incluye otras herramientas realmente tiles, como la herramienta de administracin de bases de datos phpMyAdmin, el servidor FTP FileZilla, el servidor de correo Mercury, el lenguaje de programacin Perl y el servidor JSP Tomcat.', 1, 0.00000, 0, 'https://www.apachefriends.org/es/index.html', 'https://www.apachefriends.org/download.html', 2);

